import React from 'react';

const LoginForm = () => (
  <form>
    <h2>Login</h2>
    <label>
      Username:
      <input type="text" name="username" required />
    </label>
    <label>
      Password:
      <input type="password" name="password" required />
    </label>
    <button type="submit">Login</button>
  </form>
);

export default LoginForm;
